import React from 'react';
import Navbar from '../navbar';
import { Grid } from '@material-ui/core';
import ShowClimas from './showClimas';
import FormRegister from './formRegister';
import Styles from './styles';

const Home = props => {
	const classes = Styles();

    return(
        <div>
            <Navbar />
            <Grid
			container
			direction="row"
			justify="center"
			alignItems="center">
			
				<ShowClimas />

				<FormRegister />

			</Grid>
        </div>
    );
}

export default Home;
